import React from 'react';
import './style/App.css';
import Login from './components/Login'
import Cadastro from './components/Cadastro'

function App(props) {
    let rota = 'Login';
    if (rota === 'Login') {
        return (
            <div className="App">
                <Login/>
            </div>
        );
    } else if (rota === 'Cadastro') {
        return (
            <div className="App">
                <Cadastro/>
            </div>
        );
    }
}

export default App;
